import React from "react"; 

class Search extends React.Component {
    constructor(props) {
        super(props); 
        this.data = [
            {1: "java"},
            {2: "javascript"},
            {3: "sql"}
        ]; 
        this.state = {
            matches: []
        } 
    }
    render () {
        return (
            <div>
                <input type="text"/> 
                <ul> 
                    {this.data.map((item,index) => <li key={index+1}>{item[index + 1]}</li>)}
                </ul>
            </div>
        )
    }
}

export default Search;
